export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:d,pageSize:25,pageCount:d,total:5}}},yhwBrgQR8T:{data:{id:329,attributes:{imdbId:"tt1355683",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzg0ODI3NDQxNF5BMl5BanBnXkFtZTgwMzgzNDA0NjE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"73%"},{Source:"Metacritic",Value:"68\u002F100"}],item_lang:{data:{id:992,attributes:{title:b,plot:"Based on a true story of James \"Whitey\" Bulger, an Irish Mob godfather and a FBI informant who had a \"secret trading\" deal with his brother, William \"Billy\" Bulger, a state senator and a Boston public figure, and John Connolly, an FBI agent. They planned to take down theft Italian mob and mafia in Boston, which went awry and things turned massively violent. When the credence for each other began fading out, drug dealing, murders, and extortion started to rise, and forced the FBI's Boston office to confirm that Whitey Bulger was one of the most notorious criminals in US history and also one of the FBI's Ten Most Wanted List criminals.",slug:"black-mass"}}},books:{data:[{id:3104,attributes:{title:b,description:"Now a major motion picture starring Johnny Depp A New York Times Bestseller A Boston Globe Bestseller An ABA Indie Bestseller James \"Whitey\" Bulger became one of the most ruthless gangsters in US history, and all because of an unholy deal he made with a childhood friend. John Connolly a rising star in the Boston FBI office, offered Bulger protection in return for helping the Feds eliminate Boston's Italian mafia. But no one offered Boston protection from Whitey Bulger, who, in a blizzard of gangland killings, took over the city's drug trade. Whitey's deal with Connolly's FBI spiraled out of control to become the biggest informant scandal in FBI history. Black Mass is a New York Times and Boston Globe bestseller, written by two former reporters who were on the case from the beginning. It is an epic story of violence, double-cross, and corruption at the center of which are the black hearts of two old friends whose lives unfolded in the darkness of permanent midnight.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LFCOtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e,"Gerard O'Neill"],firstBook:true,published:"2012-05-22",publisher:"PublicAffairs",subtitle:"Whitey Bulger, the FBI, and a Devil's Deal"}},{id:3105,attributes:{title:b,description:"John Connoly and James \"Whitey\" Bulger grew up together on the streets of South Boston. Decades later, in the mid 1970's, they would meet again. By then, Connolly was a major figure in the FBI's Boston office and Whitey had become godfather of the Irish Mob. What happened next--a dirty deal to bring down the Italian mob in exchange for protection for Bulger--would spiral out of control, leading to murders, drug dealing, racketeering indictments, and, ultimately, the biggest informant scandal in the history of the FBI. As told by two Boston Globe reporters who were on the case from the beginning, Black Mass is at once a riveting crime story, a cautionary tale about the abuse of power, and a penetrating look at Boston and its Irish population.--From publisher description.",thumbnail:f,authors:[e],firstBook:null,published:"2000-01-01",publisher:f,subtitle:"The True Story of an Unholy Alliance Between the FBI, and the Irish Mob"}}]}}},meta:{}}},prerenderedAt:1681309147037}}("movie","Black Mass","series",1,"Dick Lehr",""))